const Postingblogs = () => {
  return (
    <div>
      <div>
        <label>Title: </label>
        <input type="text" placeholder="Title of blog"></input>
      </div>
      <div>
        <label>Author: </label>
        <input type="text" placeholder="Author of blog"></input>
      </div>
      <div>
        <label>URL: </label>
        <input type="url" placeholder="URL of blog"></input>
      </div>
    </div>
  );
};

export default Postingblogs;
